import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { cn } from '../../utils/helpers';
import { 
  Clock, 
  BarChart3, 
  LogOut,
  Home
} from 'lucide-react';
import { RootState } from '../../services/store';
import { AuthState } from '../../types';
import { logoutUser } from '../../services/auth/auth.slice';
import { useAppDispatch } from '../../services/hooks';

export interface NavItem {
  id: string;
  label: string;
  icon: React.ReactNode;
  href?: string;
  badge?: number;
  onClick?: () => void;
}

const TopNavbar: React.FC = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const dispatch = useAppDispatch();
  const authState = useSelector((state: RootState) => state.auth) as AuthState;
  const { user } = authState;

  const navItems: NavItem[] = [
    {
      id: 'log-task',
      label: 'Log Task',
      icon: <Clock className="w-5 h-5" />,
      href: '/log-task',
    },
    {
      id: 'report',
      label: 'Report',
      icon: <BarChart3 className="w-5 h-5" />,
      href: '/report',
    },
  ];

  const handleNavClick = (item: NavItem) => {
    if (item.onClick) {
      item.onClick();
    } else if (item.href && item.href !== '#') {
      navigate(item.href);
    }
  };

  return (
    <nav className="bg-white border-b border-excel-border sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-excel-xl">
        <div className="flex items-center justify-between h-16">
          {/* Left: Logo and brand */}
          <div className="flex items-center space-x-excel-lg">
            <div className="w-10 h-10 bg-excel-blue-500 rounded-excel flex items-center justify-center">
              <span className="text-white font-bold text-excel-base">O</span>
            </div>
            <div>
              <h1 className="text-excel-lg font-semibold text-excel-text-primary">OBS Task Manager</h1>
              <p className="text-excel-xs text-excel-text-muted">Timesheet Management</p>
            </div>
          </div>

          {/* Center: Navigation items */}
          <div className="flex items-center space-x-excel-sm">
            {navItems.map((item) => (
              <button
                key={item.id}
                onClick={() => handleNavClick(item)}
                className={cn(
                  'flex items-center space-x-excel-sm px-excel-xl py-excel-md rounded-excel transition-all duration-200 font-medium',
                  location.pathname === item.href
                    ? 'bg-excel-blue-50 text-excel-blue-600'
                    : 'text-excel-text-primary hover:bg-excel-hover hover:text-excel-blue-600'
                )}
              >
                {item.icon}
                <span className="text-excel-sm">{item.label}</span>
                {item.badge && item.badge > 0 && (
                  <span className="bg-excel-blue-500 text-white text-excel-xs rounded-full px-excel-sm py-0.5 min-w-[20px] text-center">
                    {item.badge}
                  </span>
                )}
              </button>
            ))}
          </div>

          {/* Right: User menu */}
          <div className="flex items-center space-x-excel-md">
            <div className="hidden md:block text-right mr-excel-md">
              <p className="text-excel-sm font-medium text-excel-text-primary">{user?.name || 'User'}</p>
              <p className="text-excel-xs text-excel-text-muted">{user?.role || 'User'}</p>
            </div>
            <div className="w-10 h-10 bg-excel-blue-500 rounded-full flex items-center justify-center">
              <span className="text-white font-medium text-excel-sm">{user?.name?.charAt(0)?.toUpperCase() || 'U'}</span>
            </div>
            <button
              onClick={() => {
                dispatch(logoutUser());
                navigate('/login');
              }}
              className="flex items-center space-x-excel-sm px-excel-lg py-excel-md text-excel-text-primary hover:bg-excel-hover rounded-excel transition-colors duration-200"
              title="Logout"
            >
              <LogOut className="w-5 h-5" />
              <span className="hidden md:inline text-excel-sm">Logout</span>
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default TopNavbar;
